DROP TABLE IF EXISTS `filemanager_file_info`;
CREATE TABLE `filemanager_file_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `company_code` varchar(255) NOT NULL COMMENT '数据所属公司的机构编码',
  `org_code` varchar(255) NOT NULL COMMENT '数据直属机构的编码',
  `create_by` varchar(255) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(255) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '1' COMMENT '删除标记（1：正常；2：删除；3：审核）',
  `uuid` varchar(36) NOT NULL COMMENT '数据全局标识UUID',
  `stored_type` char(1) NOT NULL COMMENT '上传文件的存储类型（1：当前服务器硬盘；2：FTP服务器；3：；FastDFS服务器）',
  `file_path` varchar(255) NOT NULL COMMENT '上传文件存放路径',
  `digest` varchar(255) NOT NULL COMMENT '文件签名，用于判断是否是同一文件',
  `digest_type` char(1) NOT NULL COMMENT '文件签名算法类型（1：MD5；2：SHA-1；）',
  `file_size` bigint(20) NOT NULL COMMENT '文件大小，单位：byte(1KB = 1024byte)',
  `file_name` varchar(255) NOT NULL COMMENT '文件原名称，用户上传时的名称',
  `new_name` varchar(255) NOT NULL COMMENT '文件当前名称（UUID + 后缀名）',
  `upload_time` bigint(20) NOT NULL COMMENT '文件上传所用时间',
  `stored_time` bigint(20) NOT NULL COMMENT '文件存储用时，单位：毫秒（此时间只包含服务器端存储文件所用的时间，不包括文件上传所用的时间）',
  `file_source` varchar(255) NOT NULL COMMENT '文件来源（可以是系统模块名）',
  PRIMARY KEY (`id`),
  KEY `filemanager_file_info_digest` (`digest`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 COMMENT='上传文件信息表';

