  `del_flag` char(1) NOT NULL DEFAULT '1' COMMENT '删除标记（1：正常；2：删除；3：审核）',
  `uuid` varchar(36) NOT NULL COMMENT '数据全局标识UUID',
  `parent_id` bigint(20) NOT NULL COMMENT '父级编号,根节点的父级编号是：-1',
  `full_path` varchar(255) NOT NULL COMMENT '树结构的全路径用“-”隔开,包含自己的ID',
  `menu_type` varchar(255) NOT NULL DEFAULT '1' COMMENT '菜单类型',
  `name` varchar(50) NOT NULL COMMENT '菜单名称',
  `resources_id` bigint(20) DEFAULT NULL COMMENT '资源ID,关联表:sys_resources',
  `icon` varchar(50) DEFAULT NULL COMMENT '图标',
  `open_mode` char(1) NOT NULL DEFAULT '1' COMMENT '菜单打开方式(1:Table叶签, 2:浏览器叶签, 3:浏览器新窗口)',
  `sort` int(11) NOT NULL COMMENT '排序(升序)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='菜单表';

-- ----------------------------
-- Records of sys_menu
-- ----------------------------

-- ----------------------------
-- Table structure for sys_organization
-- ----------------------------
DROP TABLE IF EXISTS `sys_organization`;
CREATE TABLE `sys_organization` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `company_code` varchar(255) NOT NULL COMMENT '数据所属公司的机构编码',
  `org_code` varchar(255) NOT NULL COMMENT '数据直属机构的编码',
  `create_by` varchar(255) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(255) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '1' COMMENT '删除标记（1：正常；2：删除；3：审核）',
  `uuid` varchar(36) NOT NULL COMMENT '数据全局标识UUID',
  `parent_id` bigint(20) NOT NULL COMMENT '父级机构ID,根节点的父级机构ID是：-1',
  `full_path` varchar(255) NOT NULL COMMENT '树结构的全路径用“-”隔开,包含自己的ID',
  `code` varchar(255) NOT NULL COMMENT '机构编码，如：001002...',
  `name` varchar(100) NOT NULL COMMENT '机构名称',
  `org_type` char(1) NOT NULL COMMENT '机构类型,从数据字典中获取（1: 集团；2：区域；3：公司；4：部门；5：小组）',
  `address` varchar(255) DEFAULT NULL COMMENT '机构地址',
  `zip_code` varchar(50) DEFAULT NULL COMMENT '邮政编码',
  `master` varchar(100) DEFAULT NULL COMMENT '负责人',
  `phone` varchar(100) DEFAULT NULL COMMENT '电话',
  `fax` varchar(100) DEFAULT NULL COMMENT '传真',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='组织机构表';

-- ----------------------------
-- Records of sys_organization
-- ----------------------------

-- ----------------------------
-- Table structure for sys_resources
-- ----------------------------
DROP TABLE IF EXISTS `sys_resources`;
CREATE TABLE `sys_resources` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `title` varchar(255) NOT NULL COMMENT '资源标题',
  `resources_url` varchar(255) NOT NULL COMMENT '资源URL地址',
  `controller_method` varchar(255) NOT NULL COMMENT 'Spring Controller类对应的方法',
  `permission` varchar(255) NOT NULL COMMENT '资源访问所需要的权限标识字符串',
  `resources_type` char(1) NOT NULL COMMENT '资源类型（1:Web页面URL地址, 2:后台请求URL地址, 3:Web页面UI资源）',
  `need_authorization` char(1) NOT NULL COMMENT '需要授权才允许访问（1：需要；2：不需要）',
  `description` mediumtext NOT NULL COMMENT '资源说明',
  PRIMARY KEY (`id`),
  UNIQUE KEY `controller_method` (`controller_method`),
  UNIQUE KEY `permission` (`permission`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8 COMMENT='系统资源(权限)表';

-- ----------------------------
-- Records of sys_resources
-- ----------------------------

-- ----------------------------
-- Table structure for sys_resources_relation
