DROP TABLE IF EXISTS `sys_resources_relation`;
CREATE TABLE `sys_resources_relation` (
  `resources_id` bigint(20) NOT NULL COMMENT '资源ID',
  `dependence_resources_id` bigint(20) NOT NULL COMMENT '依赖的资源ID,如：数据请求URL地址、Web页面UI',
  PRIMARY KEY (`resources_id`,`dependence_resources_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统资源关系表';

