INSERT INTO `core_qlscript` VALUES ('42', 'Root', 'Root', 'Root', '2016-10-30 20:37:15', 'Root', '2016-10-30 20:40:21', '', '1', 'b6299b1d-fbd2-4d49-9c47-0d37f576455d', 'SQL', 'select\r\n	*\r\nfrom\r\n	sys_user\r\nwhere\r\n	(del_flag=:delFlag or :delFlag is null or :delFlag=\'\')\r\n	and (home_company=:homeCompany or :homeCompany is null or :homeCompany=\'\')\r\n	and (home_org=:homeOrg or :homeOrg is null or :homeOrg=\'\')\r\n	and (login_name=:loginName or :loginName is null or :loginName=\'\')\r\n	and (job_no=:jobNo or :jobNo is null or :jobNo=\'\')\r\n	and (name=:name or :name is null or :name=\'\')\r\n	and (sex=:sex or :sex is null or :sex=\'\')\r\n	and (birthday>=:birthdayStart or :birthdayStart is null)\r\n	and (birthday<=:birthdayEnd or :birthdayEnd is null)\r\n	and (email=:email or :email is null or :email=\'\')\r\n	and (phone=:phone or :phone is null or :phone=\'\')\r\n	and (mobile=:mobile or :mobile is null or :mobile=\'\')\r\n	and (user_type=:userType or :userType is null or :userType=\'\')\r\n	and (account_state=:accountState or :accountState is null or :accountState=\'\')\r\n	and (user_state=:userState or :userState is null or :userState=\'\')\r\n', 'org.cleverframe.sys.dao.UserDao.findByPage', '分页查询用户数据');
