INSERT INTO `core_template` VALUES ('15', 'Root', 'Root', 'Root', '2016-07-20 21:13:39', 'Root', '2016-07-20 21:13:39', '', '1', '406894af-4e8d-4b46-b1af-f96742c4430c', 'CSS', '/*新增表单样式Code*/\r\n#addCodeForm .row {\r\n    margin-bottom: 8px;\r\n    width: inherit;\r\n}\r\n\r\n#addCodeForm .row label {\r\n    display: inline-block;\r\n    width: 80px;\r\n    text-align: right;\r\n}\r\n\r\n#addCodeForm .row input, select {\r\n    width: 220px;\r\n}\r\n\r\n#addCodeForm .row .column {\r\n    margin-right: 30px;\r\n}\r\n\r\n#addCodeForm .row .columnLast {\r\n    margin-right: 0;\r\n}\r\n\r\n/*新增表单样式Category*/\r\n#addCategoryForm .row {\r\n    margin-bottom: 8px;\r\n    width: inherit;\r\n}\r\n\r\n#addCategoryForm .row label {\r\n    display: inline-block;\r\n    width: 80px;\r\n    text-align: right;\r\n}\r\n\r\n#addCategoryForm .row input, select {\r\n    width: 220px;\r\n}\r\n\r\n#addCategoryForm .row .column {\r\n    margin-right: 30px;\r\n}\r\n\r\n#addCategoryForm .row .columnLast {\r\n    margin-right: 0;\r\n}\r\n\r\n/*编辑表单样式Code*/\r\n#editCodeForm .row {\r\n    margin-bottom: 8px;\r\n    width: inherit;\r\n}\r\n\r\n#editCodeForm .row label {\r\n    display: inline-block;\r\n    width: 60px;\r\n    text-align: right;\r\n}\r\n\r\n#editCodeForm .row input, select {\r\n    width: 160px;\r\n}\r\n\r\n#editCodeForm .row .column {\r\n    margin-right: 15px;\r\n}\r\n\r\n#editCodeForm .row .columnLast {\r\n    margin-right: 0;\r\n}\r\n\r\n/*编辑表单样式Category*/\r\n#editCategoryForm .row {\r\n    margin-bottom: 8px;\r\n    width: inherit;\r\n}\r\n\r\n#editCategoryForm .row label {\r\n    display: inline-block;\r\n    width: 80px;\r\n    text-align: right;\r\n}\r\n\r\n#editCategoryForm .row input, select {\r\n    width: 160px;\r\n}\r\n\r\n#editCategoryForm .row .column {\r\n    margin-right: 12px;\r\n}\r\n\r\n#editCategoryForm .row .columnLast {\r\n    margin-right: 0;\r\n}\r\n\r\n/*中部叶签样式*/\r\n.tabsCenterPageTop {\r\n    margin-top: 8px;\r\n    margin-left: 15px;\r\n}\r\n\r\n.tabsCenterPageTop .row {\r\n    margin-bottom: 8px;\r\n}\r\n\r\n.tabsCenterPageTop .row .label {\r\n    text-align: left;\r\n    font-size: 14px;\r\n    font-weight: bold;\r\n}\r\n\r\n.tabsCenterPageTop .row .value {\r\n    text-align: left;\r\n    font-size: 14px;\r\n}\r\n\r\n.tabsCenterPageTop .row .column {\r\n    margin-right: 50px;\r\n}\r\n\r\n.tabsCenterPageTop .row .columnLast {\r\n    margin-right: 0;\r\n}\r\n\r\n.tabsCenterPageTop .button {\r\n    float: right;\r\n    margin-right: 10px;\r\n}\r\n\r\n/* 重写EasyUI样式-面板工具按钮间距增加 */\r\n.layout-panel .panel-tool a {\r\n    margin: 0 0 0 10px;\r\n}\r\n\r\n/*设置树节点样式*/\r\n.tree-title a {\r\n    color: #134da5;\r\n}\r\n\r\n.tree-title a:focus, .tree-title a:hover {\r\n    color: #de2c3b;\r\n}\r\n.tree-title a {\r\n    text-decoration: none;\r\n}\r\n\r\n/*自定义图标*/\r\n.icon-folderAdd{\r\n    background:url(\'image/folder_add.png\') no-repeat center center;\r\n}\r\n.icon-scriptAdd{\r\n    background:url(\'image/script_add.png\') no-repeat center center;\r\n}\r\n.icon-folderPage{\r\n    background:url(\'image/folder_page.png\') no-repeat center center;\r\n}\r\n.icon-script{\r\n    background:url(\'image/script.png\') no-repeat center center;\r\n}\r\n.icon-windowClose{\r\n    background:url(\'image/window-close-2.png\') no-repeat center center;\r\n}\r\n.icon-format{\r\n    background:url(\'image/format-indent-more-5.png\') no-repeat center center;\r\n}', 'zh_CN', 'CSS测试');
