INSERT INTO `core_template` VALUES ('19', 'Root', 'Root', 'Root', '2016-08-24 20:48:46', 'Root', '2016-08-24 20:48:46', '', '1', '8cd88339-e228-435a-af61-7ce7f2e6d36c', 'DataEntity', '<#if attributes.basePackage??>package ${attributes.basePackage}.entity</#if>\nimport org.cleverframe.core.persistence.entity.DataEntity;\nimport org.hibernate.annotations.DynamicInsert;\nimport org.hibernate.annotations.DynamicUpdate;\n\nimport javax.persistence.Entity;\nimport javax.persistence.Table;\n<#if existsDateColumn()>import java.util.Date;</#if>\n\n/**\n * 实体类，对应表${tableSchema.tableName}(${tableSchema.description})<br/>\n *\n * 作者：LiZW <br/>\n * 创建时间：${GeneratorEntityUtils.getCurrentTime()?datetime} <br/>\n */\n@Entity\n@Table(name = \"${tableSchema.tableName}\")\n@DynamicInsert\n@DynamicUpdate\npublic class ${GeneratorEntityUtils.toClassName(tableSchema.tableName)} extends DataEntity {\nprivate static final long serialVersionUID = 1L;\n\n<#list tableSchema.columnList as column>\n    <#if isExcludeColumn(column.columnName)==false >\n        /** ${column.comment} */\n        private ${GeneratorEntityUtils.toFieldType(column.dataType)} ${GeneratorEntityUtils.toFieldName(column.columnName)};\n    </#if>\n\n</#list>\n    /*--------------------------------------------------------------\n     *          getter、setter\n     * -------------------------------------------------------------*/\n\n<#list tableSchema.columnList as column>\n    <#if isExcludeColumn(column.columnName)==false >\n        <#assign fieldName = GeneratorEntityUtils.toFieldName(column.columnName)>\n        <#assign fieldType = GeneratorEntityUtils.toFieldType(column.dataType)>\n        /**\n         * 获取 ${column.comment}\n         */\n        public ${fieldType} ${GeneratorEntityUtils.toGetMethodName(fieldName, column.dataType)}() {\n            return ${fieldName};\n        }\n\n        /**\n         * 设置 ${column.comment}\n         */\n        public void ${GeneratorEntityUtils.toSetMethodName(fieldName)}(${fieldType} ${fieldName}) {\n            this.${fieldName} = ${fieldName};\n        }\n    </#if>\n\n</#list>\n}\n\n<#-- 函数  字段中是否存在Date类型，存在返回true -->\n<#function existsDateColumn>\n    <#list tableSchema.columnList as column>\n        <#if GeneratorEntityUtils.toFieldType(column.dataType)==\'Date\'>\n            <#return true>\n        </#if>\n    </#list>\n    <#return false>\n</#function>\n\n<#-- 函数  是否需要排除当前字段 -->\n<#function isExcludeColumn columnName>\n    <#if \'id\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'company_code\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'org_code\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'create_by\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'create_date\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'update_by\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'update_date\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'remarks\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'del_flag\'==columnName>\n        <#return true>\n    </#if>\n    <#if \'uuid\'==columnName>\n        <#return true>\n    </#if>\n    <#return false>\n</#function>\n\n', 'zh_CN', '实体类模版');
INSERT INTO `core_template` VALUES ('20', 'Root', 'Root', 'Root', '2016-08-24 21:04:50', 'Root', '2016-08-24 21:04:50', '', '1', '5eecd592-20d1-4a12-a566-147dccb09882', 'BaseEntity', '<#if attributes.basePackage??>package ${attributes.basePackage}.entity</#if>\nimport org.cleverframe.core.persistence.entity.BaseEntity;\n\nimport org.hibernate.annotations.DynamicInsert;\nimport org.hibernate.annotations.DynamicUpdate;\n\nimport javax.persistence.Entity;\nimport javax.persistence.Table;\n<#if existsDateColumn()>import java.util.Date;</#if>\n\n/**\n * 实体类，对应表${tableSchema.tableName}(${tableSchema.description})<br/>\n *\n * 作者：LiZW <br/>\n * 创建时间：${GeneratorEntityUtils.getCurrentTime()?datetime} <br/>\n */\n@Entity\n@Table(name = \"${tableSchema.tableName}\")\n@DynamicInsert\n@DynamicUpdate\npublic class ${GeneratorEntityUtils.toClassName(tableSchema.tableName)} implements BaseEntity {\n    private static final long serialVersionUID = 1L;\n\n<#-- 生成实体类字段 -->\n<#list tableSchema.columnList as column>\n    /** ${column.comment} */\n    private ${GeneratorEntityUtils.toFieldType(column.dataType)} ${GeneratorEntityUtils.toFieldName(column.columnName)};\n\n</#list>\n    /*--------------------------------------------------------------\n     *          getter、setter\n     * -------------------------------------------------------------*/\n\n<#-- 生成实体类getter、setter方法 -->\n<#list tableSchema.columnList as column>\n    <#assign fieldName = GeneratorEntityUtils.toFieldName(column.columnName)>\n    <#assign fieldType = GeneratorEntityUtils.toFieldType(column.dataType)>\n    /**\n     * 获取 ${column.comment}\n     */\n    public ${fieldType} ${GeneratorEntityUtils.toGetMethodName(fieldName, column.dataType)}() {\n        return ${fieldName};\n    }\n\n    /**\n     * 设置 ${column.comment}\n     */\n    public void ${GeneratorEntityUtils.toSetMethodName(fieldName)}(${fieldType} ${fieldName}) {\n        this.${fieldName} = ${fieldName};\n    }\n\n</#list>\n}\n\n\n<#-- 函数  字段中是否存在Date类型，存在返回true -->\n<#function existsDateColumn>\n    <#list tableSchema.columnList as column>\n        <#if GeneratorEntityUtils.toFieldType(column.dataType)==\'Date\'>\n            <#return true>\n        </#if>\n    </#list>\n    <#return false>\n</#function>\n\n\n\n\n\n', 'zh_CN', '实体类模版');
