INSERT INTO `core_template` VALUES ('26', 'Root', 'Root', 'Root', '2016-08-24 22:04:09', 'Root', '2016-08-24 22:04:09', '', '1', '781a8a7d-8f87-4613-a537-3725f4130eab', 'EntityService', '<#assign entityName=\"${GeneratorEntityUtils.toClassName(tableSchema.tableName)}\">\n<#assign daoClassName=\"${entityName}Dao\">\n<#assign serviceClassName=\"${entityName}Service\">\n<#if attributes.basePackage??>package ${attributes.basePackage}.service</#if>\n<#if attributes.basePackage??>import ${attributes.basePackage}.dao.${daoClassName}</#if>\nimport org.cleverframe.common.service.BaseService;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.beans.factory.annotation.Qualifier;\nimport org.springframework.stereotype.Service;\n\n\n/**\n * Service，对应表${tableSchema.tableName}(${tableSchema.description})<br/>\n *\n * 作者：LiZW <br/>\n * 创建时间：${GeneratorEntityUtils.getCurrentTime()?datetime} <br/>\n */\n@Service(BeanNames.${serviceClassName})\npublic class ${serviceClassName} extends BaseService {\n    \n    @Autowired\n    @Qualifier(BeanNames.${daoClassName})\n    private ${daoClassName} ${daoClassName?uncap_first};\n}', 'zh_CN', 'EntityService');
INSERT INTO `core_template` VALUES ('27', 'Root', 'Root', 'Root', '2016-08-24 22:17:21', 'Root', '2016-08-24 22:17:21', '', '1', '280e0dc4-732d-48d8-862c-000f3253278e', 'EntityController', '<#assign entityName = \"${GeneratorEntityUtils.toClassName(tableSchema.tableName)}\">\n<#assign serviceClassName = \"${entityName}Service\">\n<#assign controllerClassName = \"${entityName}Controller\">\n<#if attributes.basePackage??>package ${attributes.basePackage}.controller</#if>\n<#if attributes.basePackage??>import ${attributes.basePackage}.service.${serviceClassName}</#if>\nimport org.cleverframe.common.controller.BaseController;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.beans.factory.annotation.Qualifier;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.annotation.RequestMapping;\n\n/**\n * Controller\n *\n * 作者：LiZW <br/>\n * 创建时间：${GeneratorEntityUtils.getCurrentTime()?datetime} <br/>\n */\n@SuppressWarnings(\"MVCPathVariableInspection\")\n@Controller\n@RequestMapping(value = \"/${r\'${mvcPath}\'}/${attributes.moduleName!\'moduleName\'}/${entityName?lower_case}\")\npublic class ${controllerClassName} extends BaseController {\n    \n    @Autowired\n    @Qualifier(BeanNames.${serviceClassName})\n    private ${serviceClassName} ${serviceClassName?uncap_first};\n    \n}\n', 'zh_CN', 'Controller模版');
INSERT INTO `core_template` VALUES ('28', 'Root', 'Root', 'Root', '2016-08-24 23:09:17', 'Root', '2016-08-24 23:09:17', '', '1', '3ed58002-cad3-461c-8ee7-851d79ff4420', 'Select', '-- 查询所有字段\n\n\nselect\n<#list tableSchema.columnList as column>\n	${column.columnName}<#sep>, </#sep>\n</#list>\nfrom\n	${tableSchema.tableName}\nwhere \n<#list tableSchema.columnList as column>\n	<#if column.partOfPrimaryKey == true >\n		${column.columnName} = \'${column.columnName}\'\n    </#if>\n</#list>\n;\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n', 'zh_CN', 'Select模版');
