INSERT INTO `core_template` VALUES ('30', 'Root', 'Root', 'Root', '2016-08-31 21:01:38', 'Root', '2016-08-31 21:01:38', '', '1', '201c25d8-f4f2-4ce3-b4e3-0fa3782d3c3c', 'Mapper', '<!DOCTYPE mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\" \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\">\n<!--suppress SqlDialectInspection -->\n<mapper namespace=\"\">\n  <!-- 表${tableSchema.tableName}(${tableSchema.description})映射 -->\n  <resultMap id=\"BaseResultMap\" type=\"${GeneratorEntityUtils.toClassName(tableSchema.tableName)}\" >\n    <#list tableSchema.columnList as column>\n        <!-- ${column.comment} -->\n        <#if column.partOfPrimaryKey>\n            <id column=\"${column.columnName}\" property=\"${GeneratorEntityUtils.toFieldName(column.columnName)}\"/>\n        <#else>\n            <result column=\"${column.columnName}\" property=\"${GeneratorEntityUtils.toFieldName(column.columnName)}\"/>\n        </#if>\n    </#list>\n  </resultMap>\n</mapper>', 'zh_CN', 'Mapper 模版');
INSERT INTO `core_template` VALUES ('32', '-1', '-1', 'lizhiwei', '2017-01-10 18:43:27', 'lizhiwei', '2017-01-10 18:43:27', '测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速 测速', '1', '18d1f184-abb0-437c-984b-999f5047ca9e', 'Test01', 'package org.cleverframe.generator.controller;\n\nimport org.cleverframe.common.controller.BaseController;\nimport org.cleverframe.common.mapper.BeanMapper;\nimport org.cleverframe.common.tree.BuildTreeUtils;\nimport org.cleverframe.common.tree.ITreeNode;\nimport org.cleverframe.common.vo.response.AjaxMessage;\nimport org.cleverframe.core.entity.Template;\nimport org.cleverframe.generator.GeneratorBeanNames;\nimport org.cleverframe.generator.GeneratorJspUrlPath;\nimport org.cleverframe.generator.entity.CodeTemplate;\nimport org.cleverframe.generator.service.CodeTemplateService;\nimport org.cleverframe.generator.vo.request.*;\nimport org.cleverframe.webui.easyui.data.DataGridJson;\nimport org.cleverframe.webui.easyui.data.TreeGridNodeJson;\nimport org.cleverframe.webui.easyui.data.TreeNodeJson;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.beans.factory.annotation.Qualifier;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.validation.BindingResult;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.ResponseBody;\nimport org.springframework.web.servlet.ModelAndView;\n\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\nimport javax.validation.Valid;\nimport java.util.ArrayList;\nimport java.util.List;\n\n/**\n * 作者：LiZW <br/>\n * 创建时间：2016-6-21 22:02 <br/>\n */\n@SuppressWarnings(\"MVCPathVariableInspection\")\n@Controller\n@RequestMapping(value = \"/${base.mvcPath}/generator/codetemplate\")\npublic class CodeTemplateController extends BaseController {\n\n    @Autowired\n    @Qualifier(GeneratorBeanNames.CodeTemplateService)\n    private CodeTemplateService codeTemplateService;\n\n    @RequestMapping(\"/CodeTemplate\" + VIEW_PAGE_SUFFIX)\n    public ModelAndView getCodeTemplateJsp(HttpServletRequest request, HttpServletResponse response) {\n        return new ModelAndView(GeneratorJspUrlPath.CodeTemplate);\n    }\n\n    @RequestMapping(\"/TemplateEdit\" + VIEW_PAGE_SUFFIX)\n    public ModelAndView getTemplateEditJsp(HttpServletRequest request, HttpServletResponse response) {\n        return new ModelAndView(GeneratorJspUrlPath.TemplateEdit);\n    }\n\n    /**\n     * 查询所有的代码模版，构建代码模版树\n     */\n    @RequestMapping(\"/findAllCodeTemplate\")\n    @ResponseBody\n    public List<ITreeNode> findAllCodeTemplate(HttpServletRequest request, HttpServletResponse response) {\n        String isClose = request.getParameter(\"isClose\");\n        List<CodeTemplate> codeTemplateList = codeTemplateService.findAllCodeTemplate();\n        List<ITreeNode> nodes = new ArrayList<>();\n        for (CodeTemplate codeTemplate : codeTemplateList) {\n            String iconCls = null;\n            String state = \"open\";\n            if (CodeTemplate.NodeTypeCategory.equals(codeTemplate.getNodeType())) {\n                iconCls = \"icon-folderPage\";\n                if (\"true\".equalsIgnoreCase(isClose)) {\n                    state = \"closed\";\n                } else {\n                    state = \"open\";\n                }\n            } else if (CodeTemplate.NodeTypeCode.equals(codeTemplate.getNodeType())) {\n                iconCls = \"icon-script\";\n                state = \"open\";\n            }\n            TreeNodeJson node = new TreeNodeJson(\n                    codeTemplate.getParentId(),\n                    codeTemplate.getId(),\n                    codeTemplate.getFullPath(),\n                    codeTemplate.getName(), iconCls, false, state);\n            node.setAttributes(codeTemplate);\n            nodes.add(node);\n        }\n        return BuildTreeUtils.bulidTree(nodes);\n    }\n\n    /**\n     * 查询所有的代码模版，构建代码模版树\n     */\n    @RequestMapping(\"/findAllCodeTemplateToTreeGrid\")\n    @ResponseBody\n    public DataGridJson<TreeGridNodeJson<CodeTemplate>> findAllCodeTemplateToTreeGrid(HttpServletRequest request, HttpServletResponse response) {\n        DataGridJson<TreeGridNodeJson<CodeTemplate>> json = new DataGridJson<>();\n        List<CodeTemplate> codeTemplateList = codeTemplateService.findAllCodeTemplate();\n        for (CodeTemplate codeTemplate : codeTemplateList) {\n            TreeGridNodeJson<CodeTemplate> tmp = new TreeGridNodeJson<>(codeTemplate.getParentId(), codeTemplate);\n            json.addRow(tmp);\n        }\n        return json;\n    }\n\n    /**\n     * 查询代码分类的子节点，构建代码模版分类树\n     */\n    @RequestMapping(\"/findChildNode\")\n    @ResponseBody\n    public List<ITreeNode> findChildNode(\n            HttpServletRequest request,\n            HttpServletResponse response,\n            @Valid CodeTemplateQueryChildVo codeTemplateQueryChildVo,\n            BindingResult bindingResult) {\n        List<CodeTemplate> codeTemplateList = codeTemplateService.findChildNode(\n                codeTemplateQueryChildVo.getFullPath(),\n                codeTemplateQueryChildVo.getExcludePath(),\n                true);\n        List<ITreeNode> nodes = new ArrayList<>();\n        // 增加根节点\n        TreeNodeJson node = new TreeNodeJson(-1L, -1L, \"\", \"根路径\", \"icon-folderPage\", false, \"open\");\n        nodes.add(node);\n        // 加载数据库数据\n        for (CodeTemplate codeTemplate : codeTemplateList) {\n            String iconCls = null;\n            if (CodeTemplate.NodeTypeCategory.equals(codeTemplate.getNodeType())) {\n                iconCls = \"icon-folderPage\";\n            } else if (CodeTemplate.NodeTypeCode.equals(codeTemplate.getNodeType())) {\n                iconCls = \"icon-script\";\n            }\n            node = new TreeNodeJson(\n                    codeTemplate.getParentId(),\n                    codeTemplate.getId(),\n                    codeTemplate.getFullPath(),\n                    codeTemplate.getName(), iconCls, false, \"open\");\n            node.setAttributes(codeTemplate);\n            nodes.add(node);\n        }\n        return BuildTreeUtils.bulidTree(nodes);\n    }\n\n    /**\n     * 获取代码模版信息\n     */\n    @RequestMapping(\"/getCodeTemplateByName\")\n    @ResponseBody\n    public AjaxMessage<CodeTemplate> getCodeTemplateByName(\n            HttpServletRequest request,\n            HttpServletResponse response,\n            @Valid GetCodeTemplateByNameVo getCodeTemplateByNameVo,\n            BindingResult bindingResult) {\n        AjaxMessage<CodeTemplate> ajaxMessage = new AjaxMessage<>(true, \"获取代码模版信息成功\", null);\n        if (beanValidator(bindingResult, ajaxMessage)) {\n            CodeTemplate codeTemplate = codeTemplateService.getByName(getCodeTemplateByNameVo.getName());\n            ajaxMessage.setResult(codeTemplate);\n            if (codeTemplate == null) {\n                ajaxMessage.setSuccess(false);\n                ajaxMessage.setFailMessage(\"代码模版不存在\");\n            }\n        }\n        return ajaxMessage;\n    }\n\n    /**\n     * 新增代码模版-分类\n     */\n    @RequestMapping(\"/addCodeTemplateCategory\")\n    @ResponseBody\n    public AjaxMessage<String> addCodeTemplateCategory(\n            HttpServletRequest request,\n            HttpServletResponse response,\n            @Valid CodeTemplateCategoryAddVo codeTemplateCategoryAddVo,\n            BindingResult bindingResult) {\n        AjaxMessage<String> ajaxMessage = new AjaxMessage<>(true, \"新增代码模版[分类]成功\", null);\n        CodeTemplate codeTemplate = BeanMapper.mapper(codeTemplateCategoryAddVo, CodeTemplate.class);\n        codeTemplate.setNodeType(CodeTemplate.NodeTypeCategory);\n        codeTemplate.setTemplateRef(null);\n        codeTemplate.setCodeType(\"Category\");\n        if (beanValidator(bindingResult, ajaxMessage)) {\n            codeTemplateService.addCodeTemplateCategory(codeTemplate, ajaxMessage);\n        }\n        return ajaxMessage;\n    }\n\n    /**\n     * 新增代码模版-代码模版\n     */\n    @RequestMapping(\"/addCodeTemplateCode\")\n    @ResponseBody\n    public AjaxMessage<String> addCodeTemplateCode(\n            HttpServletRequest request,\n            HttpServletResponse response,\n            @Valid CodeTemplateCodeAddVo codeTemplateCodeAddVo,\n            BindingResult bindingResult) {\n        addXSSExcludeUrl(request);\n        AjaxMessage<String> ajaxMessage = new AjaxMessage<>(true, \"新增代码模版[代码模版]成功\", null);\n        CodeTemplate codeTemplate = BeanMapper.mapper(codeTemplateCodeAddVo, CodeTemplate.class);\n        codeTemplate.setNodeType(CodeTemplate.NodeTypeCode);\n        codeTemplate.setTemplateRef(codeTemplate.getName());\n        Template template = BeanMapper.mapper(codeTemplateCodeAddVo, Template.class);\n        if (beanValidator(bindingResult, ajaxMessage)) {\n            codeTemplateService.addCodeTemplateCode(codeTemplate, template, ajaxMessage);\n        }\n        return ajaxMessage;\n    }\n\n    /**\n     * 更新代码模版\n     */\n    @RequestMapping(\"/updateCodeTemplate\")\n    @ResponseBody\n    public AjaxMessage<String> updateCodeTemplate(\n            HttpServletRequest request,\n            HttpServletResponse response,\n            @Valid CodeTemplateUpdateVo codeTemplateUpdateVo,\n            BindingResult bindingResult) {\n        addXSSExcludeUrl(request);\n        AjaxMessage<String> ajaxMessage = new AjaxMessage<>(true, \"更新代码模版成功\", null);\n        CodeTemplate codeTemplate = BeanMapper.mapper(codeTemplateUpdateVo, CodeTemplate.class);\n        Template template = BeanMapper.mapper(codeTemplateUpdateVo, Template.class);\n        template.setName(codeTemplateUpdateVo.getTemplateRef());\n        // 设置ID\n        codeTemplate.setId(codeTemplateUpdateVo.getCodeTemplateId());\n        template.setId(codeTemplateUpdateVo.getTemplateId());\n        if (beanValidator(bindingResult, ajaxMessage)) {\n            codeTemplateService.updateCodeTemplate(codeTemplate, template, ajaxMessage);\n        }\n        return ajaxMessage;\n    }\n\n    /**\n     * 删除代码模版\n     */\n    @RequestMapping(\"/delCodeTemplate\")\n    @ResponseBody\n    public AjaxMessage<String> delCodeTemplate(\n            HttpServletRequest request,\n            HttpServletResponse response,\n            @Valid CodeTemplateDelVo codeTemplateDelVo,\n            BindingResult bindingResult) {\n        AjaxMessage<String> ajaxMessage = new AjaxMessage<>(true, \"删除代码模版成功\", null);\n        if (beanValidator(bindingResult, ajaxMessage)) {\n            codeTemplateService.delCodeTemplate(codeTemplateDelVo.getCodeTemplateName(), ajaxMessage);\n        }\n        return ajaxMessage;\n    }\n}\n\n// 李志伟 111 阿瑟斯\n\n', 'zh_CN', '测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试 测试');
INSERT INTO `core_template` VALUES ('33', '-1', '-1', 'lizhiwei', '2017-01-11 11:20:00', 'lizhiwei', '2017-01-11 11:20:00', '', '1', '31a37229-b737-442c-ac33-d2784d89472d', '01数据表结构变量', '------------------------------------------------------------------------------------------------------------------------------------------------------------------------\ntableSchema - 数据库表结构对象 (TableSchemaVo 对象)\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n数据库名称    - ${tableSchema.schemaName}\n表名称        - ${tableSchema.tableName}\n存储引擎      - ${tableSchema.engine}\n自动增长值    - ${tableSchema.autoIncrement}\n编码格式      - ${tableSchema.charset}\n排序字符集    - ${tableSchema.collation}\n表注释说明    - ${tableSchema.description}\n表数据总行数  - ${tableSchema.rowCount}\n数据平均长度  - ${tableSchema.avgRowLength}\n表数据总长度  - ${tableSchema.dataLength}\n表创建时间    - ${tableSchema.createTime}\n数据库列      - tableSchema.columnList (ColumnSchemaVo 对象)\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\ntableSchema.columnList - 数据库列 (ColumnSchemaVo 对象集合)\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n<#list tableSchema.columnList as column>\n--------------------------------------------------------\n数据库名称 - ${column.schemaName}\n表名称 - ${column.tableName}\n列名称 - ${column.columnName}\n序号位置 - ${column.ordinalPosition}\n字符串最大长度，数字精度 - ${column.size}\n字段精度表示 - ${column.width}\n小数位数 - ${column.decimalDigits}\n所谓Cenerated Column，就是数据库中这一列由其他列计算而得 - ${column.generated}\n是否是隐藏的列 - ${column.hidden}\n是否是外键 - ${column.partOfForeignKey}\n是否建了索引 - ${column.partOfIndex}\n是否是主键 - ${column.partOfPrimaryKey}\n是否唯一约束 - ${column.partOfUniqueIndex}\n数据类型 - ${column.dataType}\n是否不能为空 - ${column.notNull}\n是否自增长 - ${column.autoIncrement}\n默认值 - ${column.defaultValue}\n扩展属性 - ${column.extra}\n编码格式 - ${column.charset}\n排序字符集 - ${column.collation}\n列注释 - ${column.comment}\n列属性 - column.attributes (Map<String, Object> 对象)\n------------\n--------------------------------------------------------\n</#list>\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\nattributes - 生成代码的一些附加数据 (Map<String, String> 对象)\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n访问方式 attributes.xxx\n\n基础包路径    - attributes.basePackage\n模块名称      - attributes.moduleName\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\nGeneratorEntityUtils - 工具方法类对象\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n生成驼峰样式的名称 String getCamelCaseString(String inputString, boolean firstCharacterUppercase)\n    inputString             输入字符串\n    firstCharacterUppercase 首字母是否大写\ncore_resources - ${GeneratorEntityUtils.getCamelCaseString(\'core_resources\',false)}\n\n\n根据数据库表名生成类名 String toClassName(String tableName)\n    tableName 数据库表名\ncore_resources - ${GeneratorEntityUtils.toClassName(\'core_resources\')}\n\n\n根据数据库列名生成实体类字段名 String toFieldName(String columnName)\n    columnName 数据库列名\ncore_resources - ${GeneratorEntityUtils.toFieldName(\'core_resources\')}\n\n\n根据数据库列类型生成实体类字段类型 String toFieldType(String dataType)\n    dataType 数据库列类型\nINT - ${GeneratorEntityUtils.toFieldType(\'INT\')}\n\n\n根据实体类字段名生成实体类对应get方法名 String toGetMethodName(String fieldName, String dataType)\n    fieldName 实体类字段名\n    dataType  数据库列类型\ncore_resources INT - ${GeneratorEntityUtils.toGetMethodName(\'core_resources\', \'INT\')}\n\n\n根据实体类字段名生成实体类对应set方法名 String toSetMethodName(String fieldName)\n    fieldName 实体类字段名\ncore_resources - ${GeneratorEntityUtils.toSetMethodName(\'core_resources\')}\n\n获取当前时间 Date getCurrentTime()\n获取当前时间date     - ${GeneratorEntityUtils.getCurrentTime()?date}\n获取当前时间time     - ${GeneratorEntityUtils.getCurrentTime()?time}\n获取当前时间datetime - ${GeneratorEntityUtils.getCurrentTime()?datetime}\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n', 'zh_CN', '数据表结构变量');
INSERT INTO `core_template` VALUES ('34', '-1', '-1', 'lizhiwei', '2017-01-11 11:35:26', 'lizhiwei', '2017-01-11 11:35:26', '', '1', '86fc52b4-3de4-494a-a369-b7ee19b0be17', '01模板一览', '<#--\n表达式、指令、和注释\n    ${...}： FreeMarker将会输出真实的值来替换大括号内的表达式，这样的表达式被称为 interpolation(插值，译者注)\n    <#...> ... </#...>：是FreeMarker的指令，是不会在输出中打印的。这些标签的名字以 # 开头。用户自定义的FTL标签则需要使用 @ 来代替 #\n    <#-- ... -->：是FreeMarker的注释\n-->\n\n基本指令--------------------------------------------------------------------------------------------------------------------------------\n\n    if 指令--------------------------------\n<#if 1 < 2>\n    1 < 2 是true\n</#if>\n\n<#if 3 < 1>\n    3 < 1 是true\n<#else>\n    3 < 1 是false\n</#if>\n\n<#if 5 < 0>\n    5 < 0 是true\n<#elseif 5 < 1>\n    5 < 1 是true\n<#else>\n    都是false\n</#if>\n\n    list 指令--------------------------------\n<#list [\"A1\", \"A2\", 123.45] as item>\n    数据 ${item}\n    索引值 ${item?index}\n    元素位置 ${item?counter}\n    前计数的奇偶性 ${item?item_parity}\n    <#sep> | </#sep>\n<#else>\n    没有如何数据-空集合\n</#list>\n\n    include 指令--------------------------------\n<#--\n<#include \"/copyright_footer.html\">\n-->\n\n使用内建函数--------------------------------------------------------------------------------------------------------------------------------\n<#--\n    user?html 给出 user 的HTML转义版本， 比如 & 会由 &amp; 来代替\n    user?upper_case 给出 user 值的大写版本 (比如 \"JOHN DOE\" 来替代 \"John Doe\")\n    nimal.protected?string(\"Y\", \"N\") 基于 animal.protected 的布尔值来返回字符串 \"Y\" 或 \"N\"\n-->\n\n\n处理不存在的变量--------------------------------------------------------------------------------------------------------------------------------\n${a001!\"变量不存在\"}\n\n<#if a001??>\n    a001变量存在\n<#else>\n    a001变量不存在\n</#if>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n', 'zh_CN', '基本指令\r\n    if 指令\r\n    list 指令\r\n    include 指令\r\n联合使用指令\r\n使用内建函数\r\n处理不存在的变量');
INSERT INTO `core_template` VALUES ('35', '-1', '-1', 'lizhiwei', '2017-01-11 21:12:42', 'lizhiwei', '2017-01-11 21:12:42', '', '1', '35887ef5-6a64-4c37-900a-bb244fd1a760', '02表达式', '参考 http://t.bdtool.net/freemarker/dgui_template_exp.html#dgui_template_exp_direct_boolean\n\n\n直接指定值\n    字符串： \"Foo\" 或者 \'Foo\' 或者 \"It\'s \\\"quoted\\\"\" 或者 \'It\\\'s \"quoted\"\' 或者 r\"C:\\raw\\string\"\n    数字： 123.45\n    布尔值： true， false\n    序列： [\"foo\", \"bar\", 123.45]； 值域： 0..9, 0..<10 (或 0..!10), 0..\n    哈希表： {\"name\":\"green mouse\", \"price\":150}\n    \n检索变量\n    顶层变量： user\n    从哈希表中检索数据： user.name， user[\"name\"]\n    从序列中检索数据： products[5]\n    特殊变量： .main\n    \n字符串操作\n    插值(或连接)： \"Hello ${user}!\" (或 \"Hello \" + user + \"!\")\n    获取一个字符： name[0]\n    字符串切分： 包含结尾： name[0..4]，不包含结尾： name[0..<5]，基于长度(宽容处理)： name[0..*5]，去除开头： name[5..]\n    \n序列操作\n    连接： users + [\"guest\"]\n    序列切分：包含结尾： products[20..29]， 不包含结尾： products[20..<30]，基于长度(宽容处理)： products[20..*10]，去除开头： products[20..]\n\n哈希表操作\n    连接： passwords + { \"joe\": \"secret42\" }\n\n算术运算： (x * 1.5 + 10) / 2 - y % 100\n\n比较运算： x == y， x != y， x < y， x > y， x >= y， x <= y， x lt y， x lte y， x gt y， x gte y， 等等。。。。。。\n\n逻辑操作： !registered && (firstVisit || fromEurope)\n\n内建函数： name?upper_case, path?ensure_starts_with(\'/\')\n\n方法调用： repeat(\"What\", 3)\n\n处理不存在的值：\n    默认值： name!\"unknown\" 或者 (user.name)!\"unknown\" 或者 name! 或者 (user.name)!\n    检测不存在的值： name?? 或者 (user.name)??\n\n赋值操作： =, +=, -=, *=, /=, %=, ++, --\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n', 'zh_CN', '直接确定值\r\n字符串\r\n数字\r\n布尔值\r\n序列\r\n值域\r\n哈希表\r\n检索变量\r\n顶层变量\r\n从哈希表中检索数据\r\n从序列中检索数据\r\n特殊变量\r\n字符串操作\r\n插值 (或连接)\r\n获取字符\r\n字符串切分 (子串)\r\n序列操作\r\n连接\r\n序列切分\r\n哈希表操作\r\n连接\r\n算数运算\r\n比较运算\r\n逻辑操作\r\n内建函数\r\n方法调用\r\n处理不存在的值\r\n默认值操作符\r\n不存在值检测操作符\r\n赋值操作符\r\n括号\r\n表达式中的空格\r\n操作符的优先级');
INSERT INTO `core_template` VALUES ('36', '-1', '-1', 'lizhiwei', '2017-01-11 21:30:54', 'lizhiwei', '2017-01-11 21:30:54', '', '1', '50a37cc0-8343-4db1-916a-c2f085e74ec4', '03自定义指令', '基本内容--------------------------------------------------------------------------------------------------------------------------------\n\n    宏是有一个变量名的模板片段。可以在模板中使用宏作为自定义指令， 这样就能进行重复性的工作。例如：\n<#macro greet>\n    macro 指令自身不输出任何内容， 它只是用来创建宏变量，所以就会有一个名为 greet 的变量。\n    在 <#macro greet> 和 </#macro> 之间的内容 (称为 宏定义体) 将会在使用该变量作为指令时执行。\n    可以在FTL标记中通过 @代替#来使用自定义指令。\n    使用变量名作为指令名。\n</#macro>\n    使用：\n<@greet></@greet>\n或\n<@greet/>\n\n\n参数--------------------------------------------------------------------------------------------------------------------------------\n\n    在 macro 指令中，宏名称的后面位置是用来定义参数的。这里我们仅在 greet 宏中定义一个参数，person：\n<#macro greet person>\n  Hello ${person}!\n</#macro>\n    调用：\n<@greet person=\"李志伟\"/>\n\n    使用多个参数 并且 使用参数默认值\n<#macro greet person color=\"红色\">\n    ${person} 喜欢的颜色 ${color}!\n</#macro>\n    调用：\n<@greet person=\"李志伟\"/> 或 <@greet person=\"李志伟\" color=\"黑色\"/>\n\n\n嵌套内容--------------------------------------------------------------------------------------------------------------------------------\n\n    自定义指令可以嵌套内容，和预定义指令相似：<#if ...>nested content</#if>。 例如：\n<#macro border>\n    嵌套内容之前的文字 123\n    <#nested>\n    嵌套内容之后的文字 456\n</#macro>\n    <#nested> 指令执行位于开始和结束标记指令之间的模板代码段。 如果这样调用：<@border>嵌套的文字</@border> 执行结果如下：\n    \n    嵌套内容之前的文字 123\n    嵌套的文字\n    嵌套内容之后的文字 456\n\n\n宏和循环变量--------------------------------------------------------------------------------------------------------------------------------\n\n    模版如下：\n<#macro do_thrice>\n  <#nested 1>\n  <#nested 2>\n  <#nested 3>\n</#macro>\n\n    调用如下：\n<@do_thrice ; x>\n变量值 ${x}\n</@do_thrice>\n\n    将会输出：\n变量值 1\n变量值 2\n变量值 3\n\n\n自定义指令和宏进阶--------------------------------------------------------------------------------------------------------------------------------\n\n现在你也许已经阅读过 FreeMarker 参考手册的相关部分了：\n    调用自定义指令\n    macro 指令\n    也可以在FTL中定义方法，参见 function 指令。\n也许你对命名空间感兴趣： 命名空间。 命名空间可以帮助你组织和重用经常使用的宏。\n\n\n\n\n\n\n\n\n\n\n\n\n\n', 'zh_CN', '基本内容\r\n参数\r\n嵌套内容\r\n宏和循环变量\r\n自定义指令和宏进阶');
INSERT INTO `core_template` VALUES ('37', '-1', '-1', 'lizhiwei', '2017-01-11 22:09:28', 'lizhiwei', '2017-01-11 22:09:28', '', '1', '853509b3-35c7-465c-933c-f0f585a34796', '04在模板中定义变量', '在模板中可以定义三种类型的变量：\n\n\'简单\'变量： \n    它能从模板中的任何位置来访问，或者从使用 include 指令引入的模板访问。\n    可以使用 assign 指令来创建或替换这些变量。\n    因为宏和方法只是变量，那么 macro 指令 和 function 指令 也可以用来设置变量，就像 assign 那样。\n    \n局部变量：\n    它们只能被设置在 宏定义体内， 而且只在宏内可见。\n    一个局部变量的生命周期只是宏的调用过程。\n    可以使用 local指令 在宏定义体内创建或替换局部变量。\n    \n循环变量：\n    循环变量是由如 list 指令自动创建的，而且它们只在指令的开始和结束标记内有效。\n    宏 的参数是局部变量而不是循环变量。\n    \n全局变量：\n    这是一个高级话题了， 并且这种变量最好别用。\n    即便它们属于不同的命名空间， 全局变量也被所有模板共享，因为它们是被 import进来的， 不同于 include 进来的。\n    那么它们的可见度就像数据模型那样。 全局变量通过 global指令来定义。\n\n\n使用 assign 创建和替换变量--------------------------------\n\n<#assign x = 1>  <#-- create variable x -->\n${x}\n<#assign x = x + 3> <#-- replace variable x -->\n${x}\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n', 'zh_CN', '\'简单\'变量\r\n局部变量\r\n循环变量\r\n全局变量');
INSERT INTO `core_template` VALUES ('38', '-1', '-1', 'lizhiwei', '2017-01-11 22:17:42', 'lizhiwei', '2017-01-11 22:17:42', '', '1', '8fae2fc3-4bfb-47a8-a4c9-a7b6f7bb36e4', '05命名空间', null, 'zh_CN', '创建一个库\r\n在引入的命名空间中编写变量\r\n命名空间和数据模型\r\n命名空间的生命周期\r\n为他人编写库');
INSERT INTO `core_template` VALUES ('39', '-1', '-1', 'lizhiwei', '2017-01-11 22:22:33', 'lizhiwei', '2017-01-11 22:22:33', '', '1', '70b0b875-1549-4bd8-b9b5-04961273a14a', '06空白处理', '剥离空白\n\n如果对模板开启这个特性，那么它就会自动忽略 (也就是不在输出中打印出来)两种典型的多余空白：\n\n    缩进空白和在行末尾的尾部空白(包括换行符)在只包含FTL标签的行中会被忽略 (比如 <@myMacro/>, <#if ...>)和FTL注释(如 <#-- blah -->)， 除了被忽略的空白本身。\n    例如，如果一行只包含一个<#if ...>， 那么在标签前面的缩进和标签后面的换行符将会被忽略。 \n    但是，如果这行上包含<#if ...>x， 那么空白就不会被忽略，因为这个x不是FTL标签。\n    请注意，根据这些规则， 一行上包含<#if ...><#list ...>，空白就会被忽略， 而一行上有<#if ...> <#list ...>这样的就不会， 因为在两个FTL标签之间的空白是嵌入的空白，而不是缩进的或尾部空白。\n\n    加在下面这些指令之间的空白会被忽略：macro， function，assign， global，local， ftl， import， 但也是指令之间仅仅只有一个空白或FTL注释。\n    实际应用中， 它意味着你可以在宏定义和参数定义之间放置空行，因为行间距是为了更好的可读性， 不包括在输出中打印不必要的空行(换行符)。\n\n\n使用compress指令\n\n另外一种方法就是使用compress 指令。和剥离空白相反，这个工作是直接基于生成的输出内容， 而不是对于模板进行。\n也就是说，它会动态地检查输出内容， 而不会检查生成输出FTL的程序。它会很强势地移除缩进， 空行和重复的空格/制表符(可以阅读参考手册 部分来获取更多信息)。\n所以对于下面这段代码：\n\n<#compress>\n<#assign users = [{\"name\":\"Joe\",        \"hidden\":false},\n                  {\"name\":\"James Bond\", \"hidden\":true},\n                  {\"name\":\"Julia\",      \"hidden\":false}]>\nList of users:\n<#list users as user>\n  <#if !user.hidden>\n  - ${user.name}\n  </#if>\n</#list>\nThat\'s all.\n</#compress>\n\n将会输出：\n\nList of users:\n- Joe\n- Julia\nThat\'s all.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n', 'zh_CN', '剥离空白\r\n使用compress指令');
INSERT INTO `core_template` VALUES ('40', '-1', '-1', 'lizhiwei', '2017-01-11 22:27:20', 'lizhiwei', '2017-01-11 22:27:20', '', '1', '419009bb-bf18-4d9c-9929-c5ecbc4df687', '07替换(方括号)语法', 'FreeMarker支持一个替换的语法。就是在FreeMarker的指令和注释中用 [ 和 ] 来代替 < 和 >，例如下面这个例子：\n\n    调用预定义指令：[#list animals as animal]...[/#list]\n    调用自定义指令：[@myMacro /]\n    注释：[#-- the comment --]\n\n为了使用这种语法从而代替默认语法，从模板开始，使用 ftl 指令 都要使用这用语法。 \n如果你不知道什么是 ftl 指令，那么就用 [#ftl] 来开始模板，要记住这个要放在文件的最前面(除了white-space可以在它前面)。 \n例如，下面的示例是 入门 章节的最后一个例子使用这种替换语法的样子(假设这是一个完整的模板，而不是一个片段)：\n\n[#ftl]\n<p>We have these animals:\n<table border=1>\n  <tr><th>Name<th>Price\n  [#list animals as animal]\n  <tr>\n    <td>\n      [#if animal.size == \"large\"]<b>[/#if]\n      ${animal.name}\n      [#if animal.size == \"large\"]</b>[/#if]\n    <td>${animal.price} Euros\n  [/#list]\n</table>\n\n\n这种替换语法(方括号)和默认语法(尖括号)在一个模板中是相互排斥的。 \n那就是说，整个模板要么全部使用替换语法，要么全部使用默认语法。\n如果模板使用了替换语法，那么如 <#if ...> 这样的部分就会被算作是静态文本，而不是FTL标签了。\n类似地，如果模板使用默认语法， 那么如 [#if ...] 这样的也会被算作是静态文本， 而不是FTL标签。\n\n如果你以[#ftl ...] (... 代表可选的参数列表， 当然仅用 [#ftl] 也行)来开始文件，那文件就会使用替换(方括号)语法。 \n如果使用 <#ftl ...> 来开始， 那么文件就会使用正常(尖括号)语法。\n如果文件中没有 ftl 指令， 那么程序员可以通过配置FreeMarker (程序员可以参看 javadoc API 文档中的 Configuration.setTagSyntax(int)) 来决定使用哪种语法。 \n但是大多数情况，程序员可能使用默认配置。\nFreeMarker 2.3.x 版本默认配置使用常规语法。 \n而2.4版本中的默认配置将会自动检测，也就是说第一个FreeMarker标签决定了语法形式 (它可以是任意的，而不仅仅是ftl)。\n\n\n\n\n', 'zh_CN', '替换(方括号)语法');
INSERT INTO `core_template` VALUES ('41', '-1', '-1', 'lizhiwei', '2017-01-11 22:28:55', 'lizhiwei', '2017-01-11 22:28:55', '', '1', 'f67b1471-1585-463f-8de2-1a3d0e65589f', '11指令参考', 'assign\nattempt\nbreak: in switch, in list\ncase\ncompress\ndefault\nelse: in if, in list\nelseif\nescape\nfallback\nfunction\nflush\nftl\nglobal\nif\nimport\ninclude\nitems\nlist\nlocal\nlt\nmacro\nnested\nnoescape\nnoparse\nnt\nrecover\nrecurse\nreturn: in macro, in function\nrt\nsep\nsetting\nstop\nswitch\nt\nUser-defined directive (<@...>)\nvisit\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n', 'zh_CN', 'assign\r\nattempt, recover\r\ncompress\r\nescape, noescape\r\nflush\r\nftl\r\nfunction, return\r\nglobal\r\nif, else, elseif\r\nimport\r\ninclude\r\nlist, else, items, sep, break\r\nlocal\r\nmacro, nested, return\r\nnoparse\r\nnt\r\nsetting\r\nstop\r\nswitch, case, default, break\r\nt, lt, rt\r\nUser-defined directive (<@...>)\r\nvisit, recurse, fallback');
INSERT INTO `core_template` VALUES ('42', '-1', '-1', 'lizhiwei', '2017-01-11 22:29:50', 'lizhiwei', '2017-01-11 22:29:50', '', '1', 'bc77c481-5c19-4b36-b542-3548176189b9', '12特殊变量参考', '特殊变量是由FreeMarker引擎自己定义的变量。要访问它们， 你可以使用 .variable_name 语法。 \n比如，你不能仅仅写 version，而必须写.version。\n\n在 FreeMarker 2.3.23 版本中，可以使用驼峰格式的特殊变量名来代替蛇形格式， 比如 dataModel 代替 data_model。 \n但是需要知道在相同的模板中，FreeMarker 会对模板语言部分的标识符强制使用驼峰格式 (用户自定义名称是无效的)。\n\n\n\n支持的特殊变量有：\n\ncurrent_template_name： \n    当前所在的模板名称(从 FreeMarker 2.3.23 版本开始可用)。 \n    如果模板是在Java中 (通过 new Template(null, ...)) 动态创建的， 而不是从后台通过名称 (通过 cfg.getTemplate(name, ...))加载的。 \n    那么它可以为空(null)。 \n    迁移说明：如果使用它来替换废弃的 template_name， 请注意，如果模板没有名字，那么它是一个长度为0的字符串，而不是空 (null)，所以可以在遗留的模板中编写 current_template_name!\'\'。\n\ndata_model：\n    可以用来直接访问数据模型的哈希表。 \n    也就是，使用 global 指令定义在这里不可见的的变量。\n\nerror (从 FreeMarker 2.3.1 版本开始可用)： \n    该变量在 recover 指令 体中可以访问，它存储了我们要恢复错误的信息。\n\nglobals：\n    可以用来访问全局可访问的变量的哈希表： 数据模型和由 global 指令创建的变量。\n    请注意，用 assign 或 macro 创建的变量不是全局的。 因此当你使用 globals 时你不能隐藏变量。\n\nlang：\n    返回当前本地化设置的语言部分的值。 比如 .locale 是 en_US， 那么 .lang 是 en。\n\nlocale：\n    返回当前本地化设置的值。 这是一个字符串，比如 en_US。\n    要获取关于本地化字符串值的更多内容，请参考 setting 指令。\n\nlocale_object (从 FreeMarker 2.3.21 版本开始可用)： \n    以 java.util.Locale 对象返回本地化设置的当前值，而不是字符串。 \n    也就是说，当你想要传递一个 java.util.Locale 对象给Java方法时， \n    它可以用于代替 .locale。(Locale 对象会根据 object_wrapper 设置项的值来被包装。是否真的可以以 Locale 对象传递该值给Java方法依赖于对象包装器， 但是对象包装器允许你直接调用Java方法不太可能不支持它。)\n\nlocals：\n    你可以访问局部变量的哈希表 (由 local 指令创建的变量，还有宏的参数)。\n\nmain：\n    可以用来访问主命名空间的哈希表。 请注意，像数据模型中的全局变量通过这个哈希表是 不 可见的。\n\nmain_template_name：\n    顶级模板的名称 (从 FreeMarker 2.3.23 版本开始可用)。\n    (在Java中，这就是 Template.process 调用的模板) 如果模板是在Java中 (通过 new Template(null, ...)) 动态创建出来的，\n    而不是从存储器中以名称加载(通过 cfg.getTemplate(name, ...))的， \n    那么它可以不存在(null)。迁移说明： 如果使用它来替换废弃的 template_name， \n    请注意，如果模板没有名字，那么它是一个长度为0的字符串，而不是空 (null)，所以可以在遗留的模板中编写 current_template_name!\'\'。\n\nnamespace：\n    可以用来访问当前 命名空间 的哈希表。 请注意，像数据模型中的全局变量通过这个哈希表是 不 可见的。\n\nnode (由于历史原因重命名为 current_node)：\n    可以用访问者模式(也就是用 visit， recurse 等指令)处理的当前结点。 \n    而且，当使用 FreeMarker XML Ant 任务 时， 它初始存储根结点。\n\nnow：\n    返回当前的日期-时间。使用示例： \"Page generated: ${.now}\"， \"Today is ${.now?date}\"， \"The current time is ${.now?time}\"。\n\noutput_encoding (从 FreeMarker 2.3.1 版本开始可用)：\n    返回当前输出字符集的名称。 如果框架封装 FreeMarker 却没有为 FreeMarker 指定输出字符集时这个特殊变量是不存在的。 \n    (程序员可以在 这里... 阅读关于字符集问题的更多内容。)\n\ntemplate_name：\n    不要使用它， 因为当使用宏时，它的行为是很奇怪的；使用 current_template_name 或 main_template_name 来代替(参考那里的迁移说明)。\n    给出主模板的名字，如果我们运行包含或导入的模板，那么就是它们的名字。 \n    当调用宏时，那就有些困惑了：宏调用不改变该特殊变量的值，但是当 nested 被调用时，它会变成模板所属当前命名空间的名字。 (从FreeMarker 2.3.14 版本开始可用)\n\nurl_escaping_charset (从 FreeMarker 2.3.1 版本开始可用)：\n    如果存在， 它存储了应该用于URL转义的字符集的名称。\n    如果这个变量不存在就意味着没有人指定URL编码应该使用什么样的字符集。\n    这种情况下，url 内建函数 使用特殊变量 output_encoding 指定的字符集来进行URL编码。 \n    处理机制和它是相同的。(程序员可以在 这里... 阅读关于字符集问题的更多内容。)\n\nvars：\n    表达式 .vars.foo 返回和表达式 foo 相同的变量。 \n    出于某些原因你不得不使用方括号语法时这是有用的，因为它只对哈希表子变量有用， 所以你需要一个人工创建的父哈希表。\n    比如，要读取有特殊名称的顶层变量可能会把 FreeMarker 弄糊涂，\n    你可以写 .vars[\"A strange name!\"]。 或者，使用和变量 varName 给定的动态名称访问顶层变量你可以写 .vars[varName]。\n    请注意，这个哈希表由 .vars 返回，并不支持 ?keys 和 ?values。\n\nversion：\n    返回 FreeMarker 版本号的字符串形式， 比如 2.2.8。\n    这可以用来检查你的应用程序使用的是哪个版本的 FreeMarker，但是要注意这个特殊变量在 2.3.0 或 2.2.8 版本之前不存在。 \n    非最终发行版本号在数字包含破折号和进一步信息，比如 2.3.21-nightly_20140726T151800Z.\n\n\n\n\n\n\n\n\n\n', 'zh_CN', '特殊变量参考');
INSERT INTO `core_template` VALUES ('43', '-1', '-1', 'lizhiwei', '2017-01-11 22:38:11', 'lizhiwei', '2017-01-11 22:38:11', '', '1', '7098dc3d-c1cc-4fde-9daa-c1dde994d430', '13内建函数参考', null, 'zh_CN', '字母顺序索引\r\n字符串内建函数\r\n数字内建函数\r\n日期内建函数\r\n布尔值内建函数\r\n序列内建函数\r\n哈希表内建函数\r\n结点(对于XML)内建函数\r\n循环变量内建函数\r\n独立类型内建函数\r\n很少使用的和专家级的内建函数');
INSERT INTO `core_template` VALUES ('44', '-1', '-1', 'lizhiwei', '2017-01-11 22:38:34', 'lizhiwei', '2017-01-11 22:38:34', '', '1', 'b7a1c179-1db0-4ed2-8ed7-f52771b8124a', '14FTL中的保留名称', '下面的这些名称不能在非方括号语法中被用作顶层变量 (比如 .vars[\"in\"])，因为这是FTL中的关键字：\n\n    true：布尔值\"true\"\n    false：布尔值\"false\"\n    gt：比较运算符\"大于\"\n    gte：比较运算符\"大于或等于\"\n    lt：比较运算符\"小于\"\n    lte：比较运算符\"小于或等于\"\n    as：由少数指令使用\n    in：由少数指令使用\n    using：由少数指令使用\n\n\n\n\n', 'zh_CN', 'FTL 中的保留名称');
